    name text NOT NULL,
    sku text,
    barcode text,
    quantity real DEFAULT 0 NOT NULL,
    reserved_quantity real DEFAULT 0 NOT NULL,
    unit text NOT NULL,
    price real DEFAULT 0,
    location text,
    category text NOT NULL,
    supplier text,
    description text,
    min_stock real DEFAULT 0,
    track_min_stock boolean DEFAULT false NOT NULL,
    status text DEFAULT 'normal'::text NOT NULL,
    project_id text,
    project_name text,
    package_details text,
    created_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL,
    updated_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL,
    min_stock_level real DEFAULT 0,
    category_id text
);


ALTER TABLE public.warehouse_items OWNER TO emerald_user;

--
-- Name: warehouse_reservations; Type: TABLE; Schema: public; Owner: emerald_user
--

CREATE TABLE public.warehouse_reservations (
    id text NOT NULL,
    item_id text NOT NULL,
    project_id text NOT NULL,
    quantity real NOT NULL,
    status text DEFAULT 'pending'::text NOT NULL,
    reserved_by text,
    reason text,
    notes text,
    created_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL,
    updated_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL,
    released_at timestamp without time zone
);


ALTER TABLE public.warehouse_reservations OWNER TO emerald_user;

--
-- Name: warehouse_transactions; Type: TABLE; Schema: public; Owner: emerald_user
--

CREATE TABLE public.warehouse_transactions (
    id text NOT NULL,
    item_id text NOT NULL,
    type text NOT NULL,
    quantity real NOT NULL,
    user_id text NOT NULL,
    project_id text,
    notes text,
    created_at timestamp without time zone DEFAULT CURRENT_TIMESTAMP NOT NULL
);


ALTER TABLE public.warehouse_transactions OWNER TO emerald_user;

